import React from "react";
import "./Navigation.css"

export const Navigation = () => {
  return (
    <>
      <div className="navHeader">
        <div className="navLogo">
            {/* <img src={} alt=""/> */}
        </div>

        <ul>
            <li><a href='#'>HOME</a></li>
            <li><a href='#'>SHOP</a></li>
            <li><a href='#'>CATEGORY</a></li>
            <li><a href='#'>ABOUT US</a></li>
            <li><a href='#'>CONTACT US</a></li>

        </ul>
      </div>
    </>
  );
};
